import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      img:[],
    };
  }

  componentDidMount() {
    fetch("https://api.unsplash.com/search/photos/?page=1&per_page=10&")
      .then(images => images.json())
      .then(response => {
        const { memes } = response.data;
        this.setState({ 
          allImgs: memes, 
        }, () => {
          this.handleClick();
        });
      });
  }

  render() {
    return(
      <>
        <div class="content">
          <i className="fa fa-arrow-left left-icon"></i>
          <img class="image" alt="backgroundImage"/>
          <i className="fa fa-arrow-right right-icon"></i>
        </div>
      </>
    );
  }
}

export default App;
